extern "C" {
double* linspace(double start, double stop, int num) {
    auto* result = new double[num];

    double step = (stop - start) / (num - 1);
    for (int i = 0; i < num; ++i) {
        result[i] = start + i * step;
    }

    return result;
}


double to_start(double center, double extent){
    return center - extent/2;
}


double to_spacing(int x_size, double extent){
    return extent/x_size;
}


double linear_poly(double x, double a, double b){
    return x*a + b;
};


pair<int, int> findMinIndex(const vector<vector<double>>& vec) {
    if (vec.empty() || vec[0].empty())
        return {-1, -1}; // Return {-1, -1} if the vector is empty or contains empty vectors

    int max_i = 0;
    int max_j = 0;
    double min_val = vec[0][0];

    for (int i = 0; i < vec.size(); ++i) {
        for (int j = 0; j < vec[i].size(); ++j) {
            if (vec[i][j] < min_val) {
                min_val = vec[i][j];
                max_i = i;
                max_j = j;
            }
        }
    }

    return {max_i, max_j};
}



void readCSV(const string& filename, vector<double>& column1, vector<double>& column2) {
    ifstream file(filename);
    if (!file.is_open()) {
        cerr << "Error: Could not open file " << filename << endl;
        return;
    }

    string line;
    while (getline(file, line)) {
        istringstream iss(line);
        string token;
        vector<string> tokens;
        while (getline(iss, token, ',')) {
            tokens.push_back(token);
        }
        if (tokens.size() == 2) {
            try {
                double val1 = stod(tokens[0]);
                double val2 = stod(tokens[1]);
                column1.push_back(val1);
                column2.push_back(val2);
            } catch (const invalid_argument& e) {
                cerr << "Invalid argument: " << e.what() << endl;
            } catch (const out_of_range& e) {
                cerr << "Out of range: " << e.what() << endl;
            }
        } else {
            cerr << "Invalid line: " << line << endl;
        }
    }

    file.close();
}


double findMax(double* arr, int size) {
    if (size <= 0 || arr == nullptr) {
        // Handle invalid input
        return 0.0; // Return a default value or handle error appropriately
    }

    double maxVal = arr[0]; // Initialize maxVal with the first element of the array

    for (int i = 1; i < size; ++i) {
        if (arr[i] > maxVal) {
            maxVal = arr[i]; // Update maxVal if a larger value is found
        }
    }

    return maxVal;
}


pair<vector<double>, vector<double>> truncateVectors(const vector<double>& vec1, const vector<double>& vec2, double a, double b) {
    vector<double> truncatedVec1;
    vector<double> truncatedVec2;

    // Iterate through the first vector
    for (double value : vec1) {
        if (value > a && value < b) {
            truncatedVec1.push_back(value);
            truncatedVec2.push_back(value);
        }
    }

    return make_pair(truncatedVec1, truncatedVec2);
}


pair<double, double> fitlines(const double* compspec_x, double* compspec_y, double* lines, int lines_size, int compspec_size, double center, double extent){
    size_t c_size = 1000;
    size_t s_size = 1000;

    double c_cov = 200.;
    double s_cov = 0.2;

//    vector<double> theospec_wl;
//    vector<double> theospec_flx;
//
//    readCSV(compspec_fname, theospec_wl, theospec_flx);
//
//    auto result = truncateVectors(theospec_wl, theospec_flx, center-extent*0.65, center+extent*0.65);
//
//    theospec_wl = result.first;
//    theospec_flx = result.second;
//
//    double compspec_y_max = findMax(compspec_y, compspec_size);
//    double theospec_flx_max = *max_element(theospec_flx.begin(), theospec_flx.end());
//
//    #pragma omp parallel for
//    for (int i = 0; i < theospec_flx.size(); ++i) {
//        theospec_flx[i] *= compspec_y_max / theospec_flx_max;
//    }


    vector<vector<double>> fit_vals(c_size, vector<double>(s_size));
    auto* temp_lines = (double*)malloc(sizeof(double) * lines_size);

    #pragma omp parallel for
    for (int c_ind = 0; c_ind < c_size; ++c_ind) {
        double dc = linear_poly(double(c_ind), c_cov/c_size, -c_cov/2);
//        #pragma omp parallel for
        for (int s_ind = 0; s_ind < s_size; ++s_ind) {
            double ds = linear_poly(double(s_ind), s_cov/s_size,-s_cov/2);
            double sum = 0.;
//            cout << c_ind << " " << s_ind << endl;
            // cout << center+dc << " " << extent+extent*ds << endl;
            // cout << to_start(center+dc, extent+extent*ds) << endl;
            for (int i = 0; i < lines_size; ++i) {
                //cout << extent+extent*ds << endl;
                //cout << extent+extent*ds << endl;
                temp_lines[i] = linear_poly(lines[i], 1./to_spacing(compspec_size, extent+extent*ds), -to_start(center+dc, extent+extent*ds)/to_spacing(compspec_size, extent+extent*ds));// Get the x position from the lines array

                if (temp_lines[i] < compspec_x[0] || temp_lines[i] > compspec_x[compspec_size-1]) { continue; }
                double y; // Interpolated y-value

                // Find the two closest x positions in compspec_x
                int j = 0;
                while (compspec_x[j] < temp_lines[i] && j < compspec_size - 1) {
                    j++;
                }
                // Linear interpolation
                if (j == 0) {
                    y = 0;//compspec_y[0];
                } else if (j == compspec_size - 1) {
                    y = 0;//compspec_y[compspec_size - 1];
                } else {
                    double x0 = compspec_x[j - 1];
                    double x1 = compspec_x[j];
                    double y0 = compspec_y[j - 1];
                    double y1 = compspec_y[j];
                    y = y0 + (y1 - y0) * ((temp_lines[i] - x0) / (x1 - x0));
                }

                sum += y;
            }
            fit_vals[c_ind][s_ind] = sum;
        }
    }

    for (int i = 0; i < lines_size; ++i) {
        cout << temp_lines[i] << ", ";
    }
    cout << endl;

    ofstream outFile("../imagethingy.txt");

    if (outFile.is_open()) {
        // Iterate over each row
        for (const auto& row : fit_vals) {
            // Iterate over each element in the row
            for (const auto& element : row) {
                // Write the element to the file
                outFile << element << " ";
            }
            // Write newline character after each row
            outFile << "\n";
        }
        // Close the file
        outFile.close();
        cout << "Data has been written to output.txt" << endl;
    } else {
        cerr << "Unable to open file!" << endl;
    }

    delete temp_lines;
    pair <int, int> min_indices = findMinIndex(fit_vals);

    // Convert 2D vector to image
//    auto[min, max] = findMinMax(fit_vals);
//    Mat image = vectorToImage(fit_vals, min, max);

    // Display the image
//    imshow("Image", image);
//    waitKey(0);
    return {linear_poly(double(get<0>(min_indices)), c_cov/c_size, -c_cov/2), linear_poly(double(get<1>(min_indices)), s_cov/s_size,-s_cov/2)};
}}


